class Utility {
    getFullNameFromComponents(firstName, lastName, middleName, suffix) {
        var fullName = firstName + ' ' + lastName
        fullName = (middleName !== null && middleName !== '')?(fullName + ', ' + middleName):fullName 
        fullName = (suffix !== null && suffix !== '')?(fullName + ' ' + suffix):fullName
        return fullName
    }

    getBirthdayFromComponents(birthday, birthmonth) {
        return birthmonth + '/' + birthday
    }
}

export default new Utility()
